Score_distribution_b_2.query:
q = load "${App.Datasets.ED_Members_Activity_tp.FullyQualifiedName}";
q = foreach q generate 
(case when 'Engagement_Score'> 75 then "Score >75" when ('Engagement_Score'<= 75 || 'Engagement_Score' >= 50) then "Score between 50 and 75" when ('Engagement_Score'<= 50 || 'Engagement_Score' >= 25) then "Score between 25 and 50" else "Score <25" end)
 as 'Einstein Discovery scores', EnrollmentChannel, Id;
q = group q by ('EnrollmentChannel', 'Einstein Discovery scores');
q = foreach q generate 'EnrollmentChannel' as 'EnrollmentChannel', 'Einstein Discovery scores', unique('Id') as 'unique_Id';
q = order q by 'Einstein Discovery scores' asc;
q = limit q 2000;

